import React from 'react';

const Education = () => {
  return (
    <section id="education" className="text-white py-16 px-8">
      <div className="max-w-5xl mx-auto">
        <h2 className="text-4xl font-bold text-center text-primary mb-8">Education</h2>
        <div className="space-y-6">
          <div>
            <h3 className="text-xl font-semibold">B.Tech in Computer Science</h3>
            <p className="text-gray-300">CGPA: 8.53 (2021 - Present)</p>
          </div>
          <div>
            <h3 className="text-xl font-semibold">Intermediate - Sri Chaitanya Junior College</h3>
            <p className="text-gray-300">Percentage: 74.5%</p>
          </div>
          <div>
            <h3 className="text-xl font-semibold">10th - Sri Chaitanya Techno School</h3>
            <p className="text-gray-300">CGPA: 10 (100%)</p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Education;
